import React from "react";
import * as THREE from 'three'
import STLViewer from 'frontend/node_modules/stl-viewer/src/STLViewer.js'



function Stl(){


<STLViewer
	url='gear.stl'
	width={400}
	height={400}
	modelColor='#B92C2C'
	backgroundColor='#EAEAEA'
	rotate={true}
	orbitControls={true}
/>


};

export default Stl;
